import React from "react";
import { Modal, ModalHeader, ModalBody } from "reactstrap";
import "./input.css";

export default function CustomModal({
  title = "Title",
  isOpen,
  toggle,
  onCancel,
  cancelText,
  onSubmit,
  submitText,
  onDelete,
  deleteText,
  children,
}) {
  return (
    <div isOpen={isOpen} toggle={toggle}>
      <div toggle={toggle}>{title}</div>
      <div>{children}</div>
      <div>
        {onCancel && (
          <button className="text-rose-600 bg-red-600 ml-2" onClick={onCancel}>
            {cancelText || "Cancel"}
          </button>
        )}
        {onDelete && (
          <button className="text-rose-600 bg-red-600 ml-2" onClick={onDelete}>
            {deleteText || "Delete"}
          </button>
        )}
        {onSubmit && (
          <button className="text-rose-600 bg-red-600 ml-2" onClick={onSubmit}>
            {submitText || "Submit"}
          </button>
        )}
      </div>
    </div>
  );
}
